// blogs
import withLayout from "../components/MyLayout";
import Link from "next/link";

const PostLink = (props) => (
  <li>
    <Link href={`/post?title=${props.title}`}>
      <a>{props.title}</a>
    </Link>
  </li>
);

const Blog = () => {
  return (
    <div>
      <ul>
        <PostLink title="Hello World" />
      </ul>
    </div>
  );
};

export default withLayout(Blog);
